import React from "react";

const Dashboard = () => {
  const interviews = [
    { date: "2025-03-10", score: 85, feedback: "Great problem-solving skills." },
    { date: "2025-03-07", score: 72, feedback: "Improve system design understanding." },
    { date: "2025-03-03", score: 90, feedback: "Excellent technical depth!" },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-r from-purple-500 to-blue-600 flex justify-center items-center p-6">
      <div className="bg-white shadow-lg rounded-lg p-6 w-full max-w-3xl">
        <h2 className="text-2xl font-bold text-center text-gray-800 mb-4">Interview Feedback</h2>
        <table className="w-full border-collapse">
          <thead>
            <tr className="bg-gray-200">
              <th className="p-3 text-left">Date</th>
              <th className="p-3 text-left">Score</th>
              <th className="p-3 text-left">Feedback</th>
            </tr>
          </thead>
          <tbody>
            {interviews.map((interview, index) => (
              <tr key={index} className="border-b">
                <td className="p-3">{interview.date}</td>
                <td className="p-3">
                  <div className="w-full bg-gray-300 rounded-full h-4">
                    <div
                      className="h-4 bg-blue-500 rounded-full"
                      style={{ width: `${interview.score}%` }}
                    ></div>
                  </div>
                  <span className="text-sm text-gray-700">{interview.score}%</span>
                </td>
                <td className="p-3">{interview.feedback}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Dashboard;
